css:
@-moz-document domain("calendar.sunrise.am") {
.month,
.month__day--reverse,
.month__day,
.navbar__wrapper,
a,
.navbar__wrapper:after,
.navbar__item--controls__separator
{
	background: black !important;
}

.month__day,
a,
.month__row,
.month__rows,
.daynames,
.navbar__wrapper,
.navbar__item
{
	border: none !important;    
}

.occurrence__title {
	color: lightblue;
}

a.btn.btn--small {
	background: lightgreen !important;
}


.dialog__content { /* event creating popup wider - good for long title  */
	width: 44%;
}


}
